import{_get as t}from"../_modules/get/get.min.js";async function getData(){t("/api/manage/myTeam/list",null).then(t=>{for(var e="",n=0;n<t.length;n++)"true"==t[n].accessOk?e+=`<tr class="padded"><td>${t[n].nickName}</td><td><div class="inlineInput"><button class="uiButton cancelButton" onclick="disown('${t[n].id}', this)">disown user</button></div></td></tr>`:e+=`<tr class="padded"><td>${t[n].nickName}</td><td><div class="inlineInput"><button class="uiButton returnButton" onclick="approveTeamUser('${t[n].id}', this)">approve user</button></div></td></tr>`;document.getElementById("tableHeader").insertAdjacentHTML("afterend",e)}).catch(t=>console.log(t))}async function approveTeamUser(e,n){n.innerText="...",t(`/api/manage/myTeam/scouts/access/${e}/true`,n.id).then(t=>{3206===t.status?n.innerText="approved user":n.innerText="error"}).catch(t=>console.log(t))}async function disown(e,n){n.innerText="...",t(`/api/manage/myTeam/scouts/access/${e}/false`,n.id).then(t=>{3206===t.status?n.innerText="disowned":n.innerText="error"}).catch(t=>console.log(t))}window.getData=getData,window.approveTeamUser=approveTeamUser,window.disown=disown;